import React from 'react'
import '../../css/header/header.scss'

function header() {
  return (
    <div>
      <div className="container">
        <div className="header_item"></div>
        <div className="header_main"></div>
        <div className="header_menu"></div>
      </div>
    </div>
  )
}

export default header;
